      title: "Miss",
      first: "Munira",
      last: "Hennum",
    },
    email: "munira.hennum@example.com",
    picture: "https://randomuser.me/api/portraits/women/19.jpg",
    nat: "NO",
  },
  {
    gender: "female",
    name: {
      title: "Miss",
      first: "Nella",
      last: "Pulli",
    },
    email: "nella.pulli@example.com",
    picture: "https://randomuser.me/api/portraits/women/22.jpg",
    nat: "FI",
  },
  {
    gender: "female",
    name: {
      title: "Ms",
      first: "Ellen",
      last: "Neva",
    },
    email: "ellen.neva@example.com",
    picture: "https://randomuser.me/api/portraits/women/95.jpg",
    nat: "FI",
  },
];

const count = 3;
const fakeDataUrl = `https://randomuser.me/api/?results=${count}&inc=name,gender,email,nat,picture&noinfo`;

const TodoList = () => {
  const [initLoading, setInitLoading] = useState(false);
  const [data, setData] = useState([]);
  const [list, setList] = useState([]);

  useEffect(() => {
    fetch(fakeDataUrl)
      .then((res) => res.json())
      .then((res) => {
        console.log("res", res);
        setInitLoading(false);
        setData(res.results);
        setList(res.results);
      });
  }, []);

  return (
    <div>
      <List
        loading={initLoading}
        itemLayout="horizontal"
        dataSource={CUSTOMLIST}
        renderItem={(item) => {
          // ÈÅçÂéÜ dataSource ÁöÑÊï∞ÊçÆÔºåËøîÂõûÈúÄË¶ÅÊ∏≤ÊüìÁöÑÊï∞ÊçÆ
          console.log("item", item);
          return (
            <List.Item
              actions={[
                // eslint-disable-next-line jsx-a11y/anchor-is-valid
                <a key="list-loadmore-edit">edit</a>,
                // eslint-disable-next-line jsx-a11y/anchor-is-valid
                <a key="list-loadmore-more">more</a>,
              ]}
            >
              <Skeleton avatar title={false} active>
                <List.Item.Meta
                  avatar={<Avatar src={item.picture.large} />}
                  title={<a href="#/other">{item.name?.last}</a>}
                  description={
                    <>
                      <div>ÈÇÆÁÆ±üìÆÔºö{item.email}</div>
                      <div>ÂõΩÂÆ∂Ôºö{item.nat}</div>
                    </>
                  }
                />
              </Skeleton>
            </List.Item>
          );
        }}
      />
    </div>
  );
};

export default TodoList;
